import ReturnQuOteNeveR from './Quote';
import './Never.css';
import ReturnIMA from './IMA';
import Media from 'react-media';

// ReturnNeveR never compoennt 
export default function ReturnNeveR() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = () => (
 <div className='wrp-never-body'>
  <div className='wrp-subnever-body'>
   <ReturnQuOteNeveR />
   <ReturnIMA />
  </div>
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-never-body-sm'>
  <div className='wrp-subnever-body-sm'>
   <ReturnQuOteNeveR />
   <ReturnIMA />
  </div>
 </div>
);
